### Create Operation

String creation example:

```json
{
  "op": "create",
  "type": "str",
}
```

Type definition:

```typescript
interface CreateOperation {
  op: "create";  
  type: "const" | "val" | "obj" | "tup" | "str" | "arr" | "bin";
}
```

